Here is a Solidity contract based on the description provided:

```solidity
pragma solidity 0.6.12;

interface RefPayStation {
    function put(address, address) external payable;
}

contract Game {
    RefPayStation public refpaystation;
    address payable public owner;
    mapping(address => uint256) public winbalance;
    uint256 public winbalancetotal;
    uint256 public bossbalance;
    uint256 public ntsbalance;
    uint256 public prizebalance;

    constructor() payable public {
        refpaystation = RefPayStation(0x4100dAdA0D80931008a5f7F5711FFEb60A8071BA);
        winbalancetotal = 0;
        bossbalance = 0;
        ntsbalance = 0;
        owner = msg.sender;
        prizebalance = msg.value;
    }

    function payPrize(address _to, uint256 _value, uint8, uint256, uint256, uint256) public {
        require(msg.sender == owner && _value <= prizebalance);
        winbalance[_to] += _value;
        winbalancetotal += _value;
        prizebalance -= _value;
    }

    function fundPrize() public {
        require(msg.sender == owner);
        uint256 balance = address(this).balance - (winbalancetotal + bossbalance + ntsbalance + prizebalance);
        if (balance > 0) {
            prizebalance += balance;
        }
    }

    function payPostDrawRef(address _to, address _from, uint256 _value) public {
        require(msg.sender == owner && _value <= prizebalance);
        prizebalance -= _value;
        refpaystation.put{value: _value}(_to, _from);
    }

    function payNTS() public {
        require(msg.sender == owner && ntsbalance > 0);
        (bool success, ) = address(0xad0a61589f3559026F00888027beAc31A5Ac4625).call{value: ntsbalance}("");
        require(success);
        ntsbalance = 0;
    }

    function correct() public {
        require(msg.sender == owner);
        uint256 balance = address(this).balance - (winbalancetotal + bossbalance + ntsbalance + prizebalance);
        if (balance > 0) {
            bossbalance += balance;
        }
    }

    function makeBet(uint256 _value, address _ref) public payable {
        require(msg.value >= _value);
        prizebalance += msg.value - _value;
        uint256 prize = _value - (_value * 15) / 100;
        prizebalance += prize;
        bossbalance += (_value * 10) / 100;
        ntsbalance += (_value * 5) / 100;
        if (_ref != address(0)) {
            uint256 refPayment = (_value * 8) / 100;
            refpaystation.put{value: refPayment}(_ref, msg.sender);
            prize -= refPayment;
        }
        prizebalance += prize;
    }

    function newRefPayStation(address _newStation) public {
        require(msg.sender == owner);
        refpaystation = RefPayStation(_newStation);
    }

    function withdrawWin() public {
        uint256 amount = winbalance[msg.sender];
        require(amount > 0);
        winbalancetotal -= amount;
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success);
        winbalance[msg.sender] = 0;
    }

    function payBoss(uint256 _value) public {
        require(msg.sender == owner && bossbalance >= _value);
        uint256 amount = _value == 0 ? bossbalance : _value;
        uint256 toBoss = (amount * 90) / 100;
        uint256 toOther = amount - toBoss;
        (bool success, ) = address(0x42cF5e102dECCf8d89E525151c5D5bbEAc54200d).call{value: toBoss}("");
        require(success);
        (success, ) = address(0x8D86E611ef0c054FdF04E1c744A8cEFc37F00F81).call{value: toOther}("");
        require(success);
        bossbalance -= amount;
    }
}
```

Please note that the solidity version used is 0.6.12 as it was mentioned in the requirement. The contract may not work as expected if the solidity version is changed.
